import issue from './issue';
import { useState } from 'react';
import React from 'react';
import { useRef } from 'react';
import "../index.css"
const issues = ({ issues, onDelete, onEdit }) => {
  return (
    <>
      {
        issues.map((issue) => (
          <issue key={issue.id} issue={issue} onDelete={onDelete} onEdit={onEdit} />
        ))
      }
    </>
    )
}
export default issues;
